import React from 'react';

class MapKey extends React.Component {
  getNames() {
    const people = [
      { name: "John", number: 1 },
      { name: "Matt", number: 2 },
      { name: "Sydney", number: 2 },
    ];
    return people.map((person) => <p key={person.number}>{person.name}</p>);
  }

  render() {
    return (
      <div>
        <h1>MapKey:</h1>
        {this.getNames()}
      </div>
    );
  }
}

export default MapKey;
